    // console.log(unescape(encodeURIComponent(svgData)))
    // console.log(btoa(unescape(encodeURIComponent(svgData))))
  
    const image = new Image()
  
    image.addEventListener('load', () => {
      const width = 100; //input.getAttribute('width')
      const height = 100; //input.getAttribute('height')
    //   console.log(" wxh : ", width, height)
      const canvas = document.createElement('canvas')
  
      canvas.setAttribute('width', width)
      canvas.setAttribute('height', height)
  
      const context = canvas.getContext('2d')
      context.drawImage(image, 0, 0, width, height)
  
      const dataUrl = canvas.toDataURL('image/png')
    //   console.log("---- data Url : ", dataUrl)
      return dataUrl
    })
  
    image.src = svgDataUrl;
    image.crossOrigin = "Anonymous";
